  return (
    <div className="position-relative">
      <Topbar />

      {/* المحتوى الرئيسي */}
      <div style={{ marginTop: "70px" }} className="dashboard d-flex gap-1">
        <SideBar /> {/* على الشمال */}
        <div className="content flex-grow-1 p-3">
          {" "}
          {/* على اليمين */}
          <Outlet />
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
